import React from "react";
import ReactDOM from "react-dom";
import App from "./App";

ReactDOM.render(
  <>
    <App
      pic="https://assets1.ignimgs.com/2018/03/06/fortnite---button-1520296499714.jpg"
      cat="Urdu Naats"
      tit="Kabe Ki Ronak"
      link="https://youtu.be/L7dCk09AwWs"
    />
    <App />
    <App />
  </>,
  document.getElementById("root")
);
